import classes from "./Contentholder.module.css";
import Aux from "../../../HOC_AUX/Aux/Aux";
import Modal from "../../../Display/Modal/Modal";
import ProjectOverviewBox from "../../../Display/ProjectOverview/ProjectOverviewBox";

const ContentHolder = (props) => {
  let projectState = {
    1: { project: "example1", date: "4/20/20" },
    2: { project: "example2", date: "4/21/20" },
    3: { project: "example3", date: "4/22/20" },
    4: { project: "example1", date: "4/20/20" },
    5: { project: "example2", date: "4/21/20" },
    6: { project: "example3", date: "4/22/20" },
    7: { project: "example1", date: "4/20/20" },
    8: { project: "example2", date: "4/21/20" },
    9: { project: "example3", date: "4/22/20" },
    10: { project: "example1", date: "4/20/20" },
    11: { project: "example2", date: "4/21/20" },
    12: { project: "example3", date: "4/22/20" },
    13: { project: "example1", date: "4/20/20" },
    24: { project: "example2", date: "4/21/20" },
    32: { project: "example3", date: "4/22/20" },
    42: { project: "example1", date: "4/20/20" },
    52: { project: "example2", date: "4/21/20" },
    62: { project: "example3", date: "4/22/20" },
    72: { project: "example1", date: "4/20/20" },
    82: { project: "example2", date: "4/21/20" },
    92: { project: "example3", date: "4/22/20" },
    102: { project: "example1", date: "4/20/20" },
    112: { project: "example2", date: "4/21/20" },
    122: { project: "example3", date: "4/22/20" },
    displayClicked: false,
  };

  //function for handling Porject clicks
  function projectClick(event) {
    updateModalDisplay(true);
    console.log(event);
  }

  const [modalDisplay, updateModalDisplay] = useState(false);

  let stateCopy = { ...projectState };

  return (
    <React.Fragment>
      <div className={classes.ContentHolder}>
        <Modal
          title={null}
          open={modalDisplay}
          close={() => updateModalDisplay(false)}
        />
        <div className={classes.Header}>
          {" "}
          Landan <br></br> Early
        </div>
        <div className={classes.ProjectsOverview}>
          {Object.keys(stateCopy).map((currentValue) => {
            return (
              <ProjectOverviewBox
                key={Math.random()}
                clicked={console.log([currentValue].project)}
                name={stateCopy[currentValue].project}
                date={stateCopy[currentValue].date}
              />
            );
          })}
        </div>
      </div>
    </React.Fragment>
  );
};
export default ContentHolder;
